омогаете в трудных ситуациях и своим профессионализмом даете шанс на счастье! Вам можно доверить сокровенное и поделиться очень личным. Вы - надежные собеседники и мудрые наставники. Вы - тактичные, сдержанные, уверенные, внимательные, подтянутые, всегда в отличной форме! Оставайтесь всегда такими! Будьте счастливы и любимы! Будьте здоровы! И пусть ваша профессия дарит вам много радостных минут и вдохновения! А в ваших семьях царит мир, добро и благополучие! Спасибо вам, дорогие врачи! Настоящие мужчины с большой буквы! С праздником!";s:4:"TYPE";s:4:"HTML";}s:25:"PROPERTY_MESSAGE_VALUE_ID";s:8:"23543:24";s:19:"PROPERTY_FILE_VALUE";a:0:{}s:17:"PROPERTY_PD_VALUE";s:1:"1";s:20:"PROPERTY_PD_VALUE_ID";s:8:"23543:26";s:24:"PROPERTY_LAST_NAME_VALUE";N;s:27:"PROPERTY_LAST_NAME_VALUE_ID";s:9:"23543:115";s:27:"PROPERTY_IS_MODERATED_VALUE";s:1:"1";s:30:"PROPERTY_IS_MODERATED_VALUE_ID";s:9:"23543:139";s:25:"PROPERTY_SHOW_ON_EN_VALUE";N;s:28:"PROPERTY_SHOW_ON_EN_VALUE_ID";s:9:"23543:612";s:25:"PROPERTY_FILE_DESCRIPTION";a:0:{}s:31:"PROPERTY_FILE_PROPERTY_VALUE_ID";a:0:{}s:10:"specialist";b:0;s:4:"file";a:0:{}}i:23728;a:24:{s:2:"ID";s:5:"23728";s:11:"ACTIVE_FROM";s:20:"12 ноября 2016";s:9:"IBLOCK_ID";s:2:"12";s:19:"PROPERTY_NAME_VALUE";s:8:"Маша";s:22:"PROPERTY_NAME_VALUE_ID";s:8:"23728:21";s:20:"PROPERTY_EMAIL_VALUE";s:22:"larchikm2006@yandex.ru";s:23:"PROPERTY_EMAIL_VALUE_ID";s:8:"23728:22";s:25:"PROPERTY_SPECIALIST_VALUE";s:0:"";s:28:"PROPERTY_SPECIALIST_VALUE_ID";s:8:"23728:23";s:22:"PROPERTY_MESSAGE_VALUE";a:2:{s:4:"TEXT";s:1070:"Огромное спасибо Васильевой Ольге Евгеньевне и всему центру за поддержку! В апреле я родила здоровую девочку, теперь я самая счастливая на свете. Хотя ранее мне говорили, что шансов у меня почти нет. Это была по счету моя третья попытка, а в этом центре первая и победная. Спасибо Ольге Евгеньевне за то, что при возникновении проблемы и угрозы ответила на мой очень поздний звонок и тем самым сохранив моего ребёночка. Это очень важно, когда доктор все